import React from "react";
import { NavLink } from "react-router-dom";

import Button from "@material-ui/core/Button";
import { createMuiTheme, withStyles, makeStyles } from '@material-ui/core/styles';

import error404 from "../media/error/error404.svg";
import HomeIcon from "@material-ui/icons/Home";
import { green, purple } from '@material-ui/core/colors'

const BootstrapButton = withStyles({
  root: {
    boxShadow: 'none',
    textTransform: 'none',
    fontSize: '1rem',
    padding: '6px 12px',
    border: '1px solid',
    lineHeight: 1.5,
    backgroundColor: '#007bff',
    borderColor: '#007bff',
    fontFamily: [
      '-apple-system',
      'BlinkMacSystemFont',
      '"Segoe UI"',
      'Roboto',
      '"Helvetica Neue"',
      'Arial',
      'sans-serif',
      '"Apple Color Emoji"',
      '"Segoe UI Emoji"',
      '"Segoe UI Symbol"',
    ].join(','),
    '&:hover': {
      backgroundColor: '#0069d9',
      borderColor: '#0062cc',
    },
    '&:active': {
      boxShadow: 'none',
      backgroundColor: '#0062cc',
      borderColor: '#005cbf',
    },
    '&:focus': {
      boxShadow: '0 0 0 0.2rem rgba(0,123,255,.5)',
    },
  },
})(Button);

const ColorButton = withStyles(theme => ({
  root: {
    color: theme.palette.getContrastText(purple[500]),
    backgroundColor: purple[500],
    '&:hover': {
      backgroundColor: purple[700],
    },
  },
}))(Button);

const useStyles = makeStyles(theme => ({
  margin: {
    margin: theme.spacing(1),
  },
}));

const theme = createMuiTheme({
  palette: {
    primary: green,
  },
});



const Error404 = () => {
  const classes = useStyles();
  return (
    <div className="error404">
      <div className="divErrorLogo">
        <img src={error404} alt="React Logo" className="errorLogo" />
      </div>
      <h2>Oops, you broke the internet</h2>
      <p className="textError">
        Just kidding. But it seems Robo, your personal robot, can't find the
        page you're looking for. Please make sure you've entered the correct
        address, or return to Home.
      </p>
      <NavLink exact to="/" activeClassName="navActive">
      <ColorButton variant="contained" color="primary" className={classes.margin}>
        Home
      </ColorButton>
      </NavLink>
    </div>
  );
};

export default Error404;
